import React from "react";

import Header from "./Header";
import ListBody from "./ListBody";
import MyModal from "./Modal";

import { useSelector } from "react-redux";
import { useGetUsersQuery, useGetButtonQuery, useGetCurrentUserQuery } from "../redux/slices/apiSlice";

import { CircularProgress } from "@mui/material";
import { Backdrop } from "@mui/material";



const App = () => {
  const type = useSelector((state) => state.button.show);

//Redux with backend trying
  const { data, isFetching } = useGetUsersQuery();
  const { button, isButtonFetching } = useGetButtonQuery();
  console.log(data)
  if (isFetching) return <Backdrop open={true}><CircularProgress /></Backdrop>;

  return (
    <>
      <Header />
      <ListBody />
      {type && <MyModal />}
    </>
  );
};

export default App;
